import styled from 'styled-components';

const DataTableWrapper = styled.div`
  width: 100%;
  height: 100%;
  display: flex;
  flex-flow: row wrap;
`;

interface Props {}

const DataTable = ({}: Props): JSX.Element => {
  return <DataTableWrapper></DataTableWrapper>;
};

export default DataTable;
